import React, {useContext, useEffect} from 'react'
import SetContext from '../context/SetContext/SetContext';


const Set = ({match}) => {

    const setContext = useContext(SetContext);

    const CleanParams = () => {
        const param = match.params.setname
        const dashregex = /-/gi;
        const tilderegex = /~/gi;
        if (spaceregex.test(param) === true && dashregex.test(param) === false) {
            const SpaceReplaceResult = param.replaceAll(spaceregex, '-').toLowerCase()
            return SpaceReplaceResult;

        } else if (dashregex.test(param) === true && spaceregex.test(param) === false) { 
            const DashReplaceResult = param.replaceAll(dashregex, '~').toLowerCase()
            return DashReplaceResult

        } else if(dashregex.test(param) === true && spaceregex.test(param) === true) {
            const DashReplaceResult = param.replaceAll(dashregex, '~').toLowerCase()
            const ReplaceSpacesToo = DashReplaceResult.replaceAll(spaceregex, '-')
            return ReplaceSpacesToo
        } else {
            return param.toLowerCase();
        }
    }
    
    useEffect(() => {
       setContext.GetSet(CleanParams())
       console.log(setContext.SetName)
        //eslint-disable-next-line
    }, [])


    return (
        <div>
            {setContext.SetInfo && setContext.SetInfo.map((item, i) => {
                return item.name
            })}
        </div>
    )
}

export default Set
